import React from 'react'
import MealItem from './MealItem'
const Meals = () => {
  // fetch data first then show 
  // 01-state  02-async 03- effect
  const DUMY_MEALS = [ {
    id:'m1',
    name:'sidh',
    description:'tterddf',
    price:123.3
  },  {
    id:'m2',
    name:'sidh',
    description:'tterddf',
    price:123.8
    } ]


  return (
    <div>
      {DUMY_MEALS.map( meal => 
       <MealItem 
        items={PaymentResponse.ite}
        key={meal.id}
        id={meal.id}
        name={meal.name}
        description={meal.description}
        price={meal.price} /> )}
    </div>
  )
}

export default Meals
